import {Box, View, Text, AvatarFallbackText, Avatar} from '@gluestack-ui/themed';



const Bagview = ()=>{

    return(
        <Box>
            <Box bgColor='#FFA600'>
                <Avatar bgColor="$amber600" size="xl" borderRadius="$full">
                    <AvatarFallbackText>Sandeep Srivastava</AvatarFallbackText>
                </Avatar>
            </Box>

        </Box>

    );
}


export default Bagview;
